  "day2": ["Delfinariul", "Plaja Modernă"],
  "day3": ["Acvariul Constanța", "Farul Genovez"]
}

Notă: Prețurile de intrare pentru fiecare loc nu sunt specificate în enunțul problemei, așa că am presupus un preț de 10 lei pe persoană pentru muzee și parcuri și 5 lei pe persoană pentru plaje și monumente. Bugetul total de 58 lei se bazează pe această presupunere.
