  - Catedrala Mitropolitană: Aceasta este o catedrală frumoasă care are o istorie bogată și este potrivit pentru copii să învețe despre arhitectura religioasă și istoria Timișoarei.

Ziua 2:
  - Parcul Rozelor: Acesta este un parc frumos care are o varietate de flori și este potrivit pentru copii să se bucure de o plimbare și să se bucure de natură.
  - Muzeul de Artă: Acesta este un muzeu care are o colecție de artă frumoasă și este potrivit pentru copii să învețe despre arta și istoria Timișoarei.

Ziua 3:
  - Bastionul Theresia: Acesta este un monument care are o istorie bogată și este potrivit pentru copii să învețe despre istoria Timișoarei.
  - Grădina Zoologică Timișoara: Aceasta este o grădină zoologică care are o varietate de animale și este potrivit pentru copii să se bucure de o plimbare și să învețe despre animale.

